import React, { Component } from 'react';
import { Jumbotron, ListGroup } from 'react-bootstrap';
import '../index.css'

class HomePage extends Component {
    state = {}
    render() {
        return (
            <Jumbotron className='font-test' style={{ color: '#343a40' }}>
                <h3>Quickly and easily determine the redemption value of your bonds!</h3>
                <h5 style={{ margin: '2em 0 0 6em', textTransform: 'uppercase' }}>Price Your Bonds:</h5>
                <ListGroup style={{ width: '25em', margin: '1em 0 0 7.5em' }}>
                    <ListGroup.Item style={{ borderBottom: 'none', textTransform: 'uppercase' }}>Individually</ListGroup.Item>
                    <ListGroup.Item style={{ textTransform: 'uppercase' }}>From spreadsheet</ListGroup.Item>
                </ListGroup>
            </Jumbotron >
        )
    }
}

export default HomePage;
